

from skew_array import *
import unittest


class TestSkewArray(unittest.TestCase):

    def test_skew_array_0(self):
        genome = 'CATGGGCATCGGCCATACGCC'
        skew = skew_array(genome)
        a = ' '.join([str(x) for x in skew])
        b = '0 -1 -1 -1 0 1 2 1 1 1 0 1 2 1 0 0 0 0 -1 0 -1 -2'
        self.assertEqual(a, b)

    def test_skew_array_1(self):
        genome = 'GAGCCACCGCGATA'
        skew = skew_array(genome)
        a = ' '.join([str(x) for x in skew])
        b = '0 1 1 2 1 0 0 -1 -2 -1 -2 -1 -1 -1 -1'
        self.assertEqual(a, b)

    def test_minimum_skew_0(self):
        genome = 'TAAAGACTGCCGAGAGGCCAACACGAGTGCTAGAACGAGGGGCGTAAACGCGGGTCCGAT'
        skew = minimum_skew(genome)
        a = ' '.join([str(x) for x in skew])
        b = '11 24'
        self.assertEqual(a, b)

    def test_minimum_skew_1(self):
        genome = ''
        skew = minimum_skew(genome)
        a = ' '.join([str(x) for x in skew])
        b = '19772 19993 19994 19995 20000 20001 20002 20003 20026'
        self.assertEqual(a, b)


if __name__ == '__main__':
    unittest.main()
